import { Button, TextField, Typography } from "@material-ui/core";

export const UploadForm = () => {
  return (
    <>
      <label>
        <Typography variant="body2" id="upf_title">タイトル</Typography>
        <TextField size="small" fullWidth variant="outlined" aria-labelledby="rg1_label"/>
      </label>

      <label>
        <Typography variant="body2">説明</Typography>

        {/*
          <textarea>のような入力を作るために、multilineとrows={4}を指定
        */}
        <TextField
          size="small"
          fullWidth
          variant="outlined"
          multiline
          rows={4}
        />
      </label>

      <div>
        <Button variant="contained" color="primary">
          動画をアップロード
        </Button>
      </div>
    </>
  );
};
